USE sakila;
CREATE TABLE IF NOT EXISTS `fact_rental` (
    `store_key` INT,
    `address_key` INT,
    `address` VARCHAR(18) CHARACTER SET utf8,
    `district` VARCHAR(7) CHARACTER SET utf8,
    `customer_key` INT,
    `first_name` VARCHAR(11) CHARACTER SET utf8,
    `last_name` VARCHAR(12) CHARACTER SET utf8,
    `email` VARCHAR(40) CHARACTER SET utf8,
    `active` INT,
    `payment_key` INT,
    `amount` NUMERIC(4, 2),
    `rental_key` INT,
    `inventory_key` INT,
    `film_key` INT,
    `title` VARCHAR(25) CHARACTER SET utf8,
    `release_year` INT,
    `language_id` INT,
    `rental_duration` INT,
    `rental_rate` NUMERIC(3, 2),
    `length` INT,
    `replacement_cost` NUMERIC(4, 2),
    `rating` VARCHAR(5) CHARACTER SET utf8,
    `rental_date_key` INT,
    `return_date_key` INT,
    `payment_date_key` INT
);
